class Solution {
public:
    int removeCoveredIntervals(vector<vector<int>>& intervals) {
        int ans = intervals.size();
        for(int i = 0; i < intervals.size();i++){
            int f = 0;
            for(int j = 0; j < intervals.size();j++){
                if(i != j){
                    if(intervals[i][0] >= intervals[j][0] && intervals[i][1] <= intervals[j][1]){
                        f = 1;
                        break;
                    }
                }
            }
            if(f)ans--;
        }
        return ans;
    }
};
